import React from "react";
import { Link } from "react-router-dom";
import "./sidebar.css";
import { SIDEBAR_CONSTANTS } from "..";

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <ul className="side-nav-wrapper">
        {SIDEBAR_CONSTANTS.map((value) => (
          <li className="sidebar-nav" key={value.id}>
            <Link className="side-bar" to={value.path}>
              {value.text}
            </Link>
          </li>
        ))}
      </ul>
    </aside>
  );
};

export default Sidebar;
